        }
    }

    render() {
        const numberOfRows = ceil(peopleConfig.length / 4);
        console.log(numberOfRows)
        return (
            <div>
                <AbakkusNavbar />
                <Columns style={{ margin: '32px', background: '#124812' }}>
                    {
                        peopleConfig.map((person, index) => {
                            return (
                                <Columns.Column style={{ background: '#123525', margin: '16px' }}>
                                    <AbakkusPeopleCard name={person.name} description={person.description} img_url={person.img_url} />
                                </Columns.Column>
                            )
                        })
                    }
                </Columns>
            </div>
        )
    }
}

export default AbakkusPeople;
